(def plugin "Plugin to include codemirror component, use with [:codemirror-clojure {:id \"my-id\"} \" code-string]"
  {:id :codemirror
   :module '{:codemirror {:entries [org.browjure.codemirror.base]
                    :depends-on #{:browjure}}}
   :npm {:deps #{{:id "codemirror" :version "5.59.4"}}}
   :namespace "codemirror"
   :sablono {:hiccup-tag->factory-symbol
             {:codemirror-clojure 'org.browjure.codemirror.base/embed-simple-clojure-src}}
   :expandable-symbols #{'codemirror-clojure}})
